import React from 'react'
import './Style/Header.css'
import PersonIcon from '@material-ui/icons/Person';

function Header() {
    return (

        <div className='header__main'>

            <div className='header__left'>

                <PersonIcon/>
                <p>Welcome, Name</p>

            </div>
        </div>
    )
}

export default Header
